@-moz-document domain("torrentgalaxy.to") {
ul.navbar-nav > li > a:hover, ul.navbar-nav > li > a:active
{
    background-color: forestgreen;
}

body {
    background-color: #3b3b3b;	
}
.row {
    margin: 1;
}

a {
    color: blue;
}

a:hover, a:active {
    color: black;
}

#arcade {
    background-color: black;
    box-shadow:  0 0 10px 5px red inset;
}

#panelmain {
	background-color: #05b5b;
	border-color: black;
}

#panelmain legend {
	border-color: forestgreen;
}

.tgxtablerow:hover, .tgxtablerow:active, .tgxtablerow:nth-of-type(2n+1):hover, .tgxtablerow:nth-of-type(2n+1):active
